package getters

import (
	"strings"
)

// Concrete struct that implements the GetterInterface interface.
type LocalGetter struct {
	WordPicker
}

// Gets the list of words. This version picks the word list locally
func (getter LocalGetter) GetWords() []string {

	text := WORD_LIST

	wordList := strings.Split(text, "\n")

	getter.WordList = wordList

	getter.SelectWordsBySize()
	getter.ReplaceLatinCharacters()
	wordSet := map[string]bool{}
	for _, word := range getter.WordList {
		wordSet[word] = true
	}

	newList := []string{}

	for key := range wordSet {
		newList = append(newList, key)
	}

	getter.WordList = newList
	return getter.WordList
}

